  [],\n\t\"revision_timestamp\": \"2015-07-08T19:23:10.552864\",\n\t\"name\": \"uars-improved-stratospheric-and-mesospheric-sounder-isams-level-3al-v001\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Improved Stratospheric and Mesospheric
  Sounder (ISAMS) Level 3AL data product consists of daily, 4 degree increment latitude-ordered
  vertical profiles of temperature and concentrations of O3, H2O, CH4, CO, N2O, N2O5,
  NO2, and aerosol absorption coefficients.  The insrument measured infrared molecular
  emmissions in the spectral region from 4.6 to 16.6 microns.  ISAMS was flown on
  NASA's Upper Atmosphere Research Satellite (UARS) and designed to measure the global
  temperature and composition profiles in the stratosphere and mesosphere. Limb measurements
  were made in the altitude range between 15 and 60 km at about 2.5 km resolution.
  Data were collected between latitude 34S and 80N and 80S and 34N, alternating each
  satellite yaw cycle of about 36 days. The ISAMS Level 3AL data were processed with
  the version 10 algorithm, except H2O which is version 9.nnThe ISAMS level 3AL product
  consists of 10 granules per day. A data granule is one ISAMS species or subtype
  per day. The following species are measured:nnn 1) AERO12P1 - aerosol at 12.1 microns
  \ [1/km]n 2) AERO6P23 - aerosol at 6.23 microns  [1/km]n 3) CH4      - methane                  [vmr]n
  4) CO       - carbon monoxide          [vmr]n 5) H2O      - water vapor              [vmr]n
  6) N2O      - nitrous oxide            [vmr]n 7) N2O5     - nitrogen pentoxide       [vmr]n
  8) NO2      - nitrogen dioxide         [vmr]n 9) O3       - ozone                    [vmr]n10)
  TEMP     - atmospheric temperature  [Kelvin]nn*vmr = volume mixing rationnISAMS
  data are on the UARS standard pressure levels (in mbars) given by:nnP(i) =  1000
  * 10**(-i/6)  for i = 0, 1, 2, ...nnEach of the 10 ISAMS granules is accompanied
  by its own additional parameter file, designated as level 3LP.  The parameter file,
  contains the additional ancillary and quality information not found in the 3AL file.
  The data files are available in a binary record oriented format.\",\n\t\"license_title\":
